/**
 * @param {string} num1
 * @param {string} num2
 * @param {number} min_sum
 * @param {number} max_sum
 * @return {number}
 */
var count = function(num1, num2, min_sum, max_sum) {
    const MOD = 1e9 + 7;

    function digitSum(n) {
        return String(n).split('').reduce((acc, digit) => acc + Number(digit), 0);
    }

    function countGoodNumbers(lower, upper) {
        let count = 0;
        for (let i = lower; i <= upper; i++) {
            const sum = digitSum(i);
            if (sum >= min_sum && sum <= max_sum) {
                count = (count + 1) % MOD;
            }
        }
        return count;
    }

    num1 = BigInt(num1);
    num2 = BigInt(num2);
    let goodCount = 0;

    for (let i = num1; i <= num2; i++) {
        if (digitSum(i) >= min_sum && digitSum(i) <= max_sum) {
            goodCount = (goodCount + 1) % MOD;
        }
    }

    return goodCount;
};
